#intro function
def intro():
    print_type("The Cyber Saga: Covert Cryptography. Please press enter to start.")
    print("*" * 124)
    print_type("""                    You are a cyber professional with a passion for locating mysterious artefacts.
    You have stumbled across a computer code which seems to hint at an artefact you have searched for your entire life: 
                                            Your own personal holy grail. 
               
                 However,  the artefact you seek seems to be hidden behind walls of protection. 
                  You have your trusty grail diary (notes from this summer) at your disposal.
               
                                      please press enter to continue..""")
    print("*" * 124)

    while True:
        user_input = input("Do you want to continue? Enter 'y' for 'yes' and 'n' for 'no': ")

        if user_input.lower() == 'y':
    # yes!
            print_type("""Welcome to Covert Cryptography! Do you have what it takes to succeed? Answer the questions to pass through the levels and get ever closer to finding your artefact. 
                       
                       please press enter to continue.""")
            time.sleep(2)
            break
        elif user_input.lower() == 'n': 
            print_type("Maybe another time. The quest awaits until you're ready!") 
            quit()
        else:
            print_type("You have selected an invalid option. Please try again.") 
# end of intro loop
